function App() {
  const Expenses = [
    {
      id: "e1",
      title: "Car Insurance",
      price: "$566.7",
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      title: "Toilet Paper",
      price: "$200.7",
      date: new Date(2021, 7, 14),
    },
    {
      id: "e3",
      title: "New TV",
      price: "$378.8",
      date: new Date(2022, 3, 29),
    },
    {
      id: "e4",
      title: "New Desk",
      price: "$109.7",
      date: new Date(2022, 8, 21),
    },
  ];

  const ExpenseDisplay = Expenses.map((expense) => {
    return (
      <ExpenseItem
        title={expense.title}
        price={expense.price}
        date={expense.date}
      />
    );
  });
  return (
    <div>
      <NewExpense onSaveData={saveHandler} />
      <div className="container expenseBg">{ExpenseDisplay}</div>
    </div>
  );
}

export default App;
